package tk.aizydorczyk.app;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.context.event.ApplicationReadyEvent;
import org.springframework.context.ApplicationListener;
import org.springframework.stereotype.Component;
import tk.aizydorczyk.model.jpa.Car;
import tk.aizydorczyk.repository.CarRepository;

import java.math.BigDecimal;
import java.time.LocalDate;
import java.util.Base64;

@Component
public class ApplicationStartup implements ApplicationListener<ApplicationReadyEvent> {

    @Autowired
    CarRepository carRepository;

    @Override
    public void onApplicationEvent(ApplicationReadyEvent applicationReadyEvent) {

        Car car = new Car();

        car.setId(1L);
        car.setName("PORSZAK");
        car.setDateOfPurchase(LocalDate.of(2012,12,12));
        car.setPrice(new BigDecimal("1000000.20"));
        car.setLent(false);
        car.setInRepair(false);
        byte[] decode = Base64.getDecoder().decode("");
        car.setImage(decode);

        carRepository.save(car);

        Car car2 = new Car();

        car2.setId(2L);
        car2.setName("Maluch");
        car2.setDateOfPurchase(LocalDate.now());
        car2.setPrice(new BigDecimal("4324.43"));
        car2.setLent(false);
        car2.setInRepair(true);

        carRepository.save(car2);
    }

}
